import React, { Component } from 'react';
// import { Link } from 'react-router-dom';
import './home.scss';

class Home extends Component {
  render() {
    return (
      <div className='body home'>
        <h2>Shopping List</h2>
        <ul>
          <li>Item 1</li>
          <li>Item 2</li>
          <li>Item 3</li>
        </ul>
      </div>
    );
  }
}

export default Home;
